import React from "react";
import styled from "styled-components";
import { Contentdiv, TitleDiv, Row, Col, TextBox } from "./styles/commonstyle";

const Blog = () => {
  return (
    <React.Fragment>
      <Contentdiv>
        <TitleDiv>Diplomes & soft skills</TitleDiv>
        <Row>
          <Col>
            <TextBox>
            <div class="list-group">
              <a href="#" class="list-group-item list-group-item-action list-group-item-primary">Permit B</a>
              <a href="#" class="list-group-item list-group-item-action list-group-item-secondary">A simple secondary list group item</a>
              <a href="#" class="list-group-item list-group-item-action list-group-item-success">A simple success list group item</a>
              <a href="#" class="list-group-item list-group-item-action list-group-item-danger">A simple danger list group item</a>
              <a href="#" class="list-group-item list-group-item-action list-group-item-warning">A simple warning list group item</a>
              <a href="#" class="list-group-item list-group-item-action list-group-item-info">A simple info list group item</a>
              <a href="#" class="list-group-item list-group-item-action list-group-item-light">A simple light list group item</a>
              <a href="#" class="list-group-item list-group-item-action list-group-item-dark">A simple dark list group item</a>
            </div>
            </TextBox>
          </Col>
        </Row>
      </Contentdiv>
    </React.Fragment>
  );
};

export default Blog;


// Intégration et livraison continue, Production de Documentations, Méthodes Agiles, Certifié ANSSI, Communication, TOEIC - B2 ( renouvelé en 2019 ), 
// Operateur de Sécurité numérique, Responsable SSI, Permits B et 2 roues, Audio production et MAO, Production video, Curieux , Facteur de bonne humeur, Aventurier.
